BEGIN;
DROP TABLE IF EXISTS orders_products;
DROP TABLE IF EXISTS route_segments;
DROP TABLE IF EXISTS orders;
DROP TABLE IF EXISTS products;

CREATE TABLE products (
product_id INT,
weight INT NOT NULL,
CONSTRAINT PK_product PRIMARY KEY (product_id)
);

CREATE TABLE orders (
order_id INT,
customer_id INT NOT NULL,
sector_id INT NOT NULL,
planned_delivery_duration INT NOT NULL,
CONSTRAINT PK_order PRIMARY KEY (order_id)
);

CREATE TABLE orders_products (
order_id INT NOT NULL,
product_id INT NOT NULL,
quantity INT NOT NULL,
CONSTRAINT PK_order_product PRIMARY KEY (order_id, product_id),
CONSTRAINT FK_order_product_order FOREIGN KEY (order_id) REFERENCES orders(order_id),
CONSTRAINT FK_order_product_product FOREIGN KEY (product_id) REFERENCES products(product_id)
);

CREATE TYPE segment_type_enum AS ENUM ('DRIVE', 'STOP');

CREATE TABLE route_segments (
segment_id INT,
driver_id INT NOT NULL,
segment_type segment_type_enum NOT NULL,
order_id INT,
segment_start_time TIMESTAMP NOT NULL,
segment_end_time TIMESTAMP NOT NULL,
CONSTRAINT PK_segment PRIMARY KEY (segment_id),
CONSTRAINT FK_route_segment_order FOREIGN KEY (order_id) REFERENCES orders(order_id)
);

;
COMMIT;